import Foundation


// 1. 字典存储 字母个数
// 2. 数组存储 字母个数--优先采用此方法
class Solution438 {
    func findAnagrams(_ s: String, _ p: String) -> [Int] {
        let sArray = Array(s)
        let pArray = Array(p)
        
        var pNumList:[Int] = Array.init(repeating: -1, count: 26)
        
        
        var leftS = 0
        //var leftP = 0
        let sCount = sArray.count
        let pCount = pArray.count
        for i in 0..<pCount {
            if pNumList[Int(pArray[i].asciiValue!)-97] == -1 {
                pNumList[Int(pArray[i].asciiValue!)-97] = 1
            }else {
                pNumList[Int(pArray[i].asciiValue!)-97] = pNumList[Int(pArray[i].asciiValue!)-97] + 1
            }
        }
        if sCount < pCount {
            return []
        }
        var resultList:[Int] = Array()
        
        var tempArray = pNumList
        var leftP = 0
        //while(leftS <= sCount - pCount) {
        repeat {
            if tempArray[Int(sArray[leftS+leftP].asciiValue!)-97] <= 0 {
                if leftP == pCount {
//                    resultList.append(leftS)
//                    leftS = leftS + 1
                    resultList.append(leftS)
                    repeat {
                        if leftS + pCount >= sCount {
                            return resultList
                            // break
                        }
                        leftS = leftS + 1
                        if sArray[leftS - 1 + pCount] == sArray[leftS-1] {
                            resultList.append(leftS)
                        }else {
                            break
                        }
                    }while(leftS < sCount)
                }else {
                    if tempArray[Int(sArray[leftS+leftP].asciiValue!)-97] == -1 {
                        leftS = leftS + leftP + 1
                    }else {
                        leftS = leftS + 1
                    }
                }
                
                leftP = 0
                tempArray = pNumList
            }else {
                tempArray[Int(sArray[leftS+leftP].asciiValue!)-97] = tempArray[Int(sArray[leftS+leftP].asciiValue!)-97] - 1
                leftP = leftP + 1
                
                if leftP == pCount {
                    resultList.append(leftS)
                    repeat {
                        if leftS + pCount >= sCount {
                            return resultList
                            // break
                        }
                        leftS = leftS + 1
                        if sArray[leftS - 1 + pCount] == sArray[leftS-1] {
                            resultList.append(leftS)
                        }else {
                            break
                        }
                    }while(leftS < sCount)
                    
                    leftP = 0
                    tempArray = pNumList
                }
            }
        }while(leftS <= sCount - pCount)
        return resultList
    }
    
    private func characterToInt(_ char: Character) -> Int {
        let string = String(char)
        let index = string.unicodeScalars.startIndex
        let scalar = string.unicodeScalars[index]
        return Int(scalar.value) - 48
    }
    
    func test() {
        // print(findAnagrams("abeab", "abaa"))
        print(findAnagrams("cbaebabacd", "abc"))
        // 0. 6
        print(findAnagrams("abab", "ab"))
        print(findAnagrams("ababbba", "ab"))
        print(findAnagrams("abab", "abadd"))

        print(findAnagrams("abab", "abab"))
        print(findAnagrams("abab", "abae"))
        print(findAnagrams("ababe", "abae"))
        print(findAnagrams("", ""))
    }
}

